export class Student {
    id: number;
    firstName:string;
    lastName:string;
    email:string;
    password:string;
    address:string;
    phoneNumber:string;


    constructor() {
        this.id = 0;
        this.firstName = '';
        this.lastName='';
        this.email = '';
        this.password='';
        this.address='';
        this.phoneNumber='';
      }
}
